import React from 'react';
import './home.css';
import Navbar from '../../components/common/navbar';
import BackDropImg from '../../images/LandingPage/01-backdrop.jpg';
import { hexToRgb } from '@material-ui/core';

function home() {
    return (
        <>
            <Navbar />
            <img src={BackDropImg} alt="BackDropImg" style={{width:'100%'},{height:'600px'}}/>
        </>
    );
}

export default home;
